import { Col, Container, Row } from "react-bootstrap";
//import { useState } from "react";

function CarsDisplay() {
  return (
    <>
      <Container>
        <Row>
          <Col>
            <h1>Home</h1>
          </Col>
        </Row>
      </Container>
    </>
  );
}
export default CarsDisplay;
